import { createSlice } from '@reduxjs/toolkit';

export const productsSlice = createSlice({
  name: "productsSlice",
  initialState: {
    products: [],
  },
  reducers: {
    getAllProducts: (state, action) => {
      state.products = action.payload;
    },
  },
});

export const { getAllProducts } =
productsSlice.actions;

export default productsSlice.reducer;

export const fetchProducts = () => {
  return async (dispatch) => {
    try {
      const products = [
        { id: 1, title: 'Barcelona', subtitle: 'Radiohead', image: "barcelona", price: 80.000, genero: "Alternativo"},
        { id: 2, title: 'Bayern Munich', subtitle: 'Los Piojos', image: "bayern", price: 75.000, genero: 'Nacional'},
        { id: 3, title: "Boca", subtitle: 'Bad Bunny', image: "boca", price: 120.000, genero: 'Pop', },
        { id: 4, title: "Chelsea", subtitle: 'Arctic Monkeys', image: "chelsea", price: 90.000, genero: 'Rock', },
        { id: 5, title: "YHLQMDLG", subtitle:'Bad Bunny', image: "dortmund",price: 140.000, genero:'Pop'},
        { id: 6, title: "Talento De Barrio", subtitle:'Daddy Yankee', image: "inter", price: 125.000, genero: 'Pop'},
        { id: 7, title: "Easy Money Baby", subtitle:'Myke Towers', image: "liverpool", price: 100.000, genero: 'Pop'},
        { id: 8, title: "Real Hasta La Muerte", subtitle:'Anuel AA', image: "roma", price: 120.000, genero: 'Pop'},
        { id: 9, title: "Real Madrid", subtitle:'Las Pastillas Del Abuelo', image: "real", price: 70.000, genero: 'Rock'},
        { id: 10, title: "River Plate", subtitle:'Las Pastillas Del Abuelo', image: "river", price: 70.000, genero: 'Rock'}
      ]
      dispatch(getAllProducts(products));
      return products;
    } catch (error) {
      console.error("Error fetching products: ", error);
    }
  };
};
